	"326621FB4D6F": "EVAP SYS CHECK\\n\\nERROR\\nThe total time exceeded 15 min. To prevent damage to the system, the scantool stopped The EVAP SYS CHECK.",
	"326621FB4D70": "EVAP SYS CHECK\\n\\nDESCRIPTION\\nThis test activates the PURGE VSV, VENT VALVE, VACUUM PUMP and FUEL VCV to draw and release vacuum in the system. System operation can be confirmed by observing Vapor Pressure during each step.",
	"326621FB4D71": "EVAP SYS CHECK\\n\\nCHECK\\nConfirm the following conditions:\\n\\nGear Selector is in PARK\\nIG is ON\\nEngine is OFF\\nFuel temperature is below 95F (35C)\\nFuel level is less than 9/10\\nFuel door is closed (to remain close during Check)\\n\\nHINT: EVAP Sys Check can only be executed once every key cycle. If completed already, please press cancel, and restart this utility after cycling the key.",
